package com.twjitm.email;import java.util.Date;/** * @author twjitm - [Created on 2018-08-24 12:21] * @company https://github.com/twjitm/ * @jdk java version "1.8.0_77" */public class User {    private long id;    private String email;    private String password;    private String username;    private String role;    private int status;    private Date regTime;    private String regIp;    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public String getEmail() {        return email;    }    public void setEmail(String email) {        this.email = email;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getRole() {        return role;    }    public void setRole(String role) {        this.role = role;    }    public int getStatus() {        return status;    }    public void setStatus(int status) {        this.status = status;    }    public Date getRegTime() {        return regTime;    }    public void setRegTime(Date regTime) {        this.regTime = regTime;    }    public String getRegIp() {        return regIp;    }    public void setRegIp(String regIp) {        this.regIp = regIp;    }}